import React from 'react';
import styled from 'styled-components';

const Projects = () => {
    return (
        <ProjectsContainer>
        <div id='projects'>
            Projects
        </div>
        </ProjectsContainer>
    );
}

export default Projects;

const ProjectsContainer = styled.div`
    display: flex;  
    padding: 20%;
background-color: red;
        `;
